import Calender from "./calender";
import Note from "./note";

import React from "react";

const Demo = () => {
  return (
    <div>
      <div>Calender</div>
      <div>Note</div>

      {true ? <Calender /> : <Note />}
    </div>
  );
};

export default Demo;
